1. Suspension et résiliation du Service de l’Utilisateur

Si l’utilisateur publie des informations illégales, enfreint gravement la moralité sociale ou enfreint les interdictions de la loi, le développeur doit mettre fin à la fourniture de services à l’utilisateur ;
Si l’utilisateur commet un acte inapproprié en acceptant le service logiciel, le développeur a le droit de résilier le service fourni à l’utilisateur (les circonstances spécifiques du comportement inapproprié sont clairement stipulées dans le présent contrat) ;
Si l’utilisateur utilise une version modifiée du logiciel d’un tiers, l’utilisateur supporte ses propres risques et sa responsabilité légale.

2. Suspension, suspension et résiliation du Logiciel et des Services：

Dans l’une des circonstances suivantes, le développeur a le droit de résilier ou d’interrompre tout ou partie des services du logiciel, et le développeur ne sera pas responsable envers l’utilisateur ou un tiers des désagréments ou dommages causés par celui-ci：

a. comme l’exigent le Logiciel et les Services ;
b. Défaut de fonctionnement en raison d’un dommage au serveur ;
c. En raison d’une défaillance soudaine de l’équipement logiciel et matériel et de l’équipement de communication électronique ;
d. en raison d’une défaillance de la ligne du fournisseur de réseau ou d’autres défaillances ;
e. pour des raisons de politique générale ;
f. Raisons de tiers ou autres circonstances de force majeure.

Le Développeur se réserve le droit de résilier ou de résilier partiellement le Logiciel et les Services lorsqu’il le juge nécessaire, et le Développeur peut en informer l’Utilisateur sous la forme d’une annonce, mais le Développeur ne sera pas responsable des pertes causées à l’Utilisateur.

